import React from "react";
import { Col, Container,Row } from "react-bootstrap";

function Checkout() {
    return (
    <>
    <Container className="tablecont">
        <Row >
         <Col>
         <Col className="bg-dark text-white">LOGIN OR SIGNUP</Col>
         </Col>
         <Col></Col>
        </Row>
    </Container>
    </>  );
}

export default Checkout;
